import math

with open('expresie.in') as fin, open('expresie.out', 'w') as fout:
    m = int(fin.readline())
    n = int(fin.readline())
    x = list(map(int, fin.readline().split()))
    p = int(math.pow(x[0] * x[1] * x[2] * x[3], 1 / m))
    if p**m == x[0] * x[1] * x[2] * x[3]:
        fout.write('1\n')
        for i in range(2, int(math.sqrt(p)) + 1):
            cnt = 0
            while p % i == 0:
                p //= i
                cnt += 1
            if cnt > 0:
                fout.write(f'{i} {cnt}\n')
        if p > 1:
            fout.write(f'{p} 1\n')
    else:
        fout.write('0\n')
